import React from 'react';
import {  Card } from 'react-bootstrap';




const weatherDay = ({temp, weather, day}) => {



  return (
    <Card style={{ width: '18rem' }}>
        <Card.Body>
            <Card.Title>{temp}</Card.Title>
            <Card.Text>
                {weather}
                {day}
            </Card.Text>
        </Card.Body>
    </Card>
  );
};

export default weatherDay;
